import React, { useState } from "react";
import "../css/hover-menu-items-shape.css";

import { ButtonComponent } from "./ButtonComponent";
import Arrow from "../ShapeForms/Arrow.png";
import Circle from "../ShapeForms/Circle.png";
import Line from "../ShapeForms/Line.png";
import Rectangle from "../ShapeForms/Rectangle.png";
import Dash_Arrow from "../ShapeForms/Dash_Arrow.png";
import Dash_Circle from "../ShapeForms/Dash_Circle.png";
import Dash_Line from "../ShapeForms/Dash_Line.png";
import Dash_Rectangle from "../ShapeForms/Dash_Rectangle.png";

export const HoverMenuItems_Shapes = () => {
  const shapes = [
    { name: "Arrow", bgImg: "../ShapeForms/Arrow.png", whatItDoes: () => {} },
    {
      name: "Rectangle",
      bgImg: "../ShapeForms/Rectangle.png",
      whatItDoes: () => {},
    },
    { name: "Line", bgImg: "../ShapeForms/Line.png", whatItDoes: () => {} },
    { name: "Circle", bgImg: "../ShapeForms/Circle.png", whatItDoes: () => {} },
    {
      name: "DashedArrow",
      bgImg: "../ShapeForms/Dash_Arrow.png",
      whatItDoes: () => {},
    },
    {
      name: "DashedRectangle",
      bgImg: "../ShapeForms/Dash_Rectangle.png",
      whatItDoes: () => {},
    },
    {
      name: "DashedLine",
      bgImg: "../ShapeForms/Dash_Line.png",
      whatItDoes: () => {},
    },
    {
      name: "DashedCircle",
      bgImg: "../ShapeForms/Dash_Circle.png",
      whatItDoes: () => {},
    },
  ];
  return (
    <div className="container">
      {shapes.map((item, _) => (
        <img src="../ShapeForms/Dash_Circle.png">
          <button
            onMouseDown={() => {
              item.whatItDoes();
            }}
          ></button>
        </img>
      ))}
    </div>
  );
};
